"original": |2-
     This REQUIRED attribute identifies the IPP version(s) that this
     Printer supports, including major and minor versions, i.e., the
     version numbers for which this Printer implementation meets the
     conformance requirements.  For version number validation, the Printer
     matches the (2-octet binary) "version-number" parameter supplied by
     the Client in each request (see Sections 4.1.1 and 4.1.8) with the
     (US-ASCII) 'keyword' values of this attribute.
"fixed": |-
  This REQUIRED attribute identifies the IPP version(s) that this Printer supports, including major and minor versions, i.e., the version numbers for which this Printer implementation meets the conformance requirements.  For version number validation, the Printer matches the (2-octet binary) "version-number" parameter supplied by the Client in each request (see Sections 4.1.1 and 4.1.8) with the (US-ASCII) 'keyword' values of this attribute.
"ko": |-
  이 필수 속성은 주 버전과 부 버전을 포함하여 이 프린터가 지원하는 IPP 버전, 즉 이 프린터 구현이 적합성 요구 사항을 충족하는 버전 번호를 식별합니다. 버전 번호 확인을 위해 프린터는 각 요청(섹션 4.1.1 및 4.1.8 참조)에서 클라이언트가 제공한 (2옥텟 이진) "버전 번호" 매개변수를 (US-ASCII) '키워드' 값과 일치시킵니다. 이 속성의.
